script: |
  super -f text -I q10763.spq | sort > q10763.out

inputs:
  - name: q10763.spq
    data: |
      SELECT - - 39 / + ( - col0 ) AS col0 FROM tab0 (FORMAT parquet) WHERE + col1 * - col2 NOT IN ( + + col1, - ( + col2 ) + + + ( col2 ) / col0 * + 5 + + 66 );
  - name: tab0

outputs:
  - name: q10763.out
    data: |
      -2
      0
      0
